import React from "react";
import "./HowToDO.css";
import image1 from "../User-images/laptop11.webp";
function HowToDo() {
  return (
    <div>
      <br />
      <h1 style={{ textAlign: "center", fontFamily: "inherit" }}>
        <b>How-To</b>
        <hr style={{ marginLeft: "5%", marginRight: "5%" }} />
      </h1>
    </div>
  );
}

export default HowToDo;
